import{_ as e,c as t,o as a,a4 as r}from"./chunks/framework.CzsDe1xi.js";const s="/assets/chromabyfremy.CX-tk9t2.png",o="/assets/amparcanes.Cu6PGr_U.png",i="/assets/ampsetup.5hgrXWbe.png",n="/assets/voltspeedrunbuild.DJtRM6RQ.png",l="/assets/ogrisbuild.BD4ApCle.png",d="/assets/ogrisriven.C2Hl1mCH.png",h="/assets/diplosbuild.DrEYnId8.png",p="/assets/diplerriven.DoyFgnyT.png",u="/assets/ballazaw.Cd9cbw86.png",g="/assets/ballariven.D1WUMg2r.png",c="/assets/mechvelo.Czh7cu7K.png",m="/assets/mechveloriven.BxjvPk-9.png",f="/assets/wispbuild.hzTAQYFZ.png",C=JSON.parse('{"title":"Solo Speedrun Builds","description":"","frontmatter":{},"headers":[],"relativePath":"advanced/solo-speedrun-builds.md","filePath":"advanced/solo-speedrun-builds.md"}'),b={name:"advanced/solo-speedrun-builds.md"},y=r('<h1 id="solo-speedrun-builds" tabindex="-1"><strong>Solo Speedrun Builds</strong> <a class="header-anchor" href="#solo-speedrun-builds" aria-label="Permalink to &quot;**Solo Speedrun Builds**&quot;">​</a></h1><p><em>These builds differ from basic builds in some notable ways due to stuff like the expected skill of the user and utilized tools. Builds that seek to buff certain things explicitly at the cost of other things normally seen as essential belong here.</em></p><p><strong>Please do not mindlessly copy these builds. As a rule, they are extremely specialized. Read the descriptions, and ask any further questions in the discord.</strong></p><h2 id="credit-farming-setup" tabindex="-1"><strong>Credit Farming Setup</strong> <a class="header-anchor" href="#credit-farming-setup" aria-label="Permalink to &quot;**Credit Farming Setup**&quot;">​</a></h2><h3 id="chroma" tabindex="-1"><strong>Chroma</strong> <a class="header-anchor" href="#chroma" aria-label="Permalink to &quot;**Chroma**&quot;">​</a></h3><p>by <a href="https://www.youtube.com/watch?v=glgE1dip6Tc" target="_blank" rel="noreferrer"><strong>Fremy</strong></a></p><div style="width:100%;text-align:left;"><img src="'+s+'" alt="chromabyfremy" style="width:100%;height:auto;"></div><p><a href="https://overframe.gg/build/610242/" target="_blank" rel="noreferrer"><em><strong>Overframe Link</strong></em></a></p><p>— Alternatives —</p><p><strong>Less Umbral formas:</strong></p><p>You will have less power strength, but you can replace any umbral mods with their regular versions. Chroma is rather tanky already, especially if you use elemental ward for defense purposes, so the lack of Umbral Vitality/Fiber shouldn’t hurt much. You can also consider replacing Fiber or Vitality with utility like Natural Talent.</p><p><strong>Padless:</strong></p><p>Arcane Nullifier is optional, but recommended if you plan on running without energy pads. With one Tauforged amber shard you should have enough energy to cast Eclipse 3 times, and have the energy for Effigy at the end.<br> If you want to cast Elemental Ward, you can either use more yellow shards, or change Vigorous Swap to Preparation or Flow.</p><p><strong>No Primed Sure Footed:</strong></p><p>If you don’t have PSF, you can replace it with Handspring or add regular Sure Footed and replace Umbral Vitality/Fiber/Vigorous Swap with Fortitude.</p><h3 id="operator" tabindex="-1"><strong>Operator</strong> <a class="header-anchor" href="#operator" aria-label="Permalink to &quot;**Operator**&quot;">​</a></h3><p>To make the best use of the Operator element coverage, Madurai is essential. Void Strike gives you a massive damage increase while also emptying your Operator energy, therefore guaranteeing Eternal Onslaught in the process. The best weapon to use is a Klamora - Certus (7x7) Amp because of its continuous high damage output.</p><div style="display:flex;flex-wrap:wrap;"><img src="'+o+'" alt="amparcanes" style="max-width:62.5%;min-width:267px;padding:3px;"><img src="'+i+'" alt="ampsetup" style="max-width:37.5%;min-width:130px;padding:3px;"></div><h2 id="speedrunning-setup" tabindex="-1"><strong>Speedrunning Setup</strong> <a class="header-anchor" href="#speedrunning-setup" aria-label="Permalink to &quot;**Speedrunning Setup**&quot;">​</a></h2><h3 id="volt" tabindex="-1"><strong>Volt</strong> <a class="header-anchor" href="#volt" aria-label="Permalink to &quot;**Volt**&quot;">​</a></h3><div style="width:100%;text-align:left;"><img src="'+n+'" alt="voltspeedrunbuild" style="width:100%;height:auto;"></div><p><a href="https://overframe.gg/build/610238/" target="_blank" rel="noreferrer"><em><strong>Overframe Link</strong></em></a></p><p>Low duration Volt build. The higher range is so Total Eclipse more reliably buffs On Call Crew. Amar’s Hatred is a flex slot for this build and only used because of its polarity, because these polarities are compatible with both Eidolon and Arbitration builds. Relies on Ancient Healer Specter and/or shield pads to stay alive.</p><p>Natural Talent can be replaced with Augur Secrets and yellow archon shards or cast speed can be dropped altogether. Primed Sure footed can be replaced with Power Drift past a certain pace as knockdowns become increasingly rare and Wyrm can pick up the slack. Unairu is also an option if using power drift or if you don’t have PSF. Arcane Awakening is flex and can be replaced by either Molt Efficiency if you need more duration or Arcane Guardian if you have trouble staying alive.</p><h2 id="weapon-builds" tabindex="-1"><strong>Weapon Builds</strong> <a class="header-anchor" href="#weapon-builds" aria-label="Permalink to &quot;**Weapon Builds**&quot;">​</a></h2><h3 id="kuva-ogris" tabindex="-1"><strong>Kuva Ogris</strong> <a class="header-anchor" href="#kuva-ogris" aria-label="Permalink to &quot;**Kuva Ogris**&quot;">​</a></h3><div style="width:100%;text-align:left;"><img src="'+l+'" alt="ogrisbuild" style="width:100%;height:auto;"></div><p><a href="https://overframe.gg/build/610245/" target="_blank" rel="noreferrer"><em><strong>Overframe Link</strong></em></a></p><p>Kuva Ogris is entirely for pylons. Magazine size mods are so that you have enough shots for all pylons. Damage and multishot on riven lets you always twotick with decent power strength (rip Eclipse). Projectile speed gives the most QoL out of any third stat.</p><div style="width:25%;text-align:left;"><img src="'+d+'" alt="ogrisriven" style="width:100%;height:auto;"></div><h3 id="zenith" tabindex="-1"><strong>Zenith</strong> <a class="header-anchor" href="#zenith" aria-label="Permalink to &quot;**Zenith**&quot;">​</a></h3><p><strong>This weapon is now defunct due to the speed and ease of use of Kuva Ogris. You can see it in old versions of the guide <a href="/miscellaneous/resources-used-honorable-mentions.html"><strong>here</strong></a>.</strong></p><h3 id="tenet-diplos" tabindex="-1"><strong>Tenet Diplos</strong> <a class="header-anchor" href="#tenet-diplos" aria-label="Permalink to &quot;**Tenet Diplos**&quot;">​</a></h3><div style="width:100%;text-align:left;"><img src="'+h+'" alt="diplosbuild" style="width:100%;height:auto;"></div><p><a href="https://overframe.gg/build/396859/" target="_blank" rel="noreferrer"><em><strong>Overframe Link</strong></em></a></p><p>Tenet Diplos doesn’t have much build variety. This build expects riven to have both toxin and cold, however, a riven with only one of the two will work, in which case replace Accelerated Isotope with the missing element. Diplos uses magnetic progenitor.</p><div style="width:25%;text-align:left;"><img src="'+p+'" alt="diplerriven" style="width:100%;height:auto;"></div><h3 id="balla-dagger-zaw" tabindex="-1"><strong>Balla Dagger Zaw</strong> <a class="header-anchor" href="#balla-dagger-zaw" aria-label="Permalink to &quot;**Balla Dagger Zaw**&quot;">​</a></h3><div style="width:100%;text-align:left;"><img src="'+u+'" alt="ballazaw" style="width:100%;height:auto;"></div><p><a href="https://overframe.gg/build/396863/" target="_blank" rel="noreferrer"><em><strong>Overframe Link</strong></em></a></p><p>High attack speed build, it saves a few milliseconds. Volt shield, Vigorous Swap, and Eclipse makes damage-increasing mods unnecessary, so the riven is only for increasing attack speed.</p><div style="width:25%;text-align:left;"><img src="'+g+'" alt="ballariven" style="width:100%;height:auto;"></div><h3 id="mech-velocitus" tabindex="-1"><strong>Mech Velocitus</strong> <a class="header-anchor" href="#mech-velocitus" aria-label="Permalink to &quot;**Mech Velocitus**&quot;">​</a></h3><div style="width:100%;text-align:left;"><img src="'+c+'" alt="mechvelo" style="width:100%;height:auto;"></div><p><a href="https://overframe.gg/build/396891/" target="_blank" rel="noreferrer"><em><strong>Overframe Link</strong></em></a></p><p>This is a bless fr riven build without ms. If you have a riven that has ms, then depending on if your riven also has heat/electric you’ll replace either a heat/electric mod or Hollowed Bullets. If no damage blessing, replace Automatic Trigger with Hollowed Bullets (if you don’t have it on already) or a 60/60 heat/electric mod.</p><div style="width:25%;text-align:left;"><img src="'+m+'" alt="mechveloriven" style="width:100%;height:auto;"></div><h3 id="crewmate-torid" tabindex="-1"><strong>Crewmate Torid</strong> <a class="header-anchor" href="#crewmate-torid" aria-label="Permalink to &quot;**Crewmate Torid**&quot;">​</a></h3><div style="width:100%;text-align:left;"><img src="'+f+'" alt="crewmatetorid" style="width:100%;height:auto;"></div><p><a href="https://overframe.gg/build/622921/" target="_blank" rel="noreferrer"><em><strong>Overframe Link</strong></em></a></p><p>Explained in <a href="/advanced/speedrun-strats.html#on-call-strats"><strong>on call strats</strong></a>, only works well with +150% primary cc crewmate. Make sure your crewmate isn’t behind your mech.</p>',51),v=[y];function w(_,k,x,S,P,q){return a(),t("div",null,v)}const A=e(b,[["render",w]]);export{C as __pageData,A as default};
